import React from "react";
import ListItem from "./list-item";

const TodoList = ({todos}) => {

    const elementsTodos = todos.map(({label, important = false}) =>  {
        return (
            <li><ListItem
                label={label}
                important={important} />
            </li>
        );
    })

    return (
        <ul>
            {elementsTodos}
        </ul>
    );
}
console.log({elementsTodos})
export default TodoList;
